clc;
clear all;

% APs Jointly estimate

MRC_emperical = [];
MRC_theoretical = [];
MRC_emperical_equation = [];

user_location_total = [];

for t = 1:1000
    
    cell_size = 500;
    shadow = 8;
    M = 50;
    N = 2;
    K = 100;
    K_active = 10;
    tau = 5;
    P = [1,2,3,4];
    SNR_db = 111;
    SNR_linear = 10^(SNR_db/10);
    bit = 2*ones(M,1);
    alpha = 1-pi*sqrt(3)/2*2.^(-2*bit);
    
    for i = 1:size(P,2)
        [success_rate_CF_K1(t,i)] = ADMM(cell_size,shadow,M,N,K,K_active,tau,P(i),SNR_linear,alpha,'CF');
    end
end

plot(P,mean(success_rate_CF_K1),'LineWidth',2,'Color','#D95319','LineStyle','--'); hold on;
xlabel('$P$','interpreter','latex', 'FontSize', 20, 'FontName', 'Times New Roman');
ylabel('Detection rate','interpreter','latex', 'FontSize', 20, 'FontName', 'Times New Roman');

function [success_rate] = ADMM(cell_size,shadow,M,N,K,K_active,tau,P,SNR_linear,alpha,key)
% Generate channel

h = cellfun(@(~)cellfun(@(~)(randn(N,P)+1i*randn(N,P))/sqrt(2),cell(K,1),'UniformOutput',false),cell(M,1),'UniformOutput',false);

if strcmp(key,'CF')
    base_location = (rand(M,1)-0.5)*2*cell_size+1i*(rand(M,1)-0.5)*2*cell_size;
elseif strcmp(key,'CO')
    base_location = zeros(M,1);
end

user_location = (rand(K,1)-0.5)*2*cell_size+1i*(rand(K,1)-0.5)*2*cell_size;
distance = abs(base_location-user_location.');
beta = (distance/1).^(-3.5).*10.^(10^(shadow/10)*(randn(M,K))/10);

% Transmit pilot
pilot = (normc(randn(tau,K))+1i*normc(randn(tau,K)))/sqrt(2);
x_p = pilot;
x_p = x_p./repmat(sum(abs(x_p).^2),tau,1);
x_p_time_domain=cellfun(@(a)a(1:P,:),cellfun(@(a)(dftmtx(tau)/sqrt(tau))'*diag(a)*(dftmtx(tau)/sqrt(tau)),mat2cell(x_p,tau,ones(K,1)),'UniformOutput',false),'UniformOutput',false)';
% Activity
index = randperm(K,K_active); activity = zeros(K,1); activity(index) = 1;
y_p_clean=cellfun(@(d,e)sqrt(tau*SNR_linear)*sum(cat(3,e{:}).*reshape(activity.*d',1,1,[]),3),mat2cell(sqrt(beta),ones(M,1),K),cellfun(@(c)cellfun(@(a,b)a*b,c,x_p_time_domain,'UniformOutput',false),h,'UniformOutput',false),'UniformOutput',false);
y_p = cellfun(@(a)a+(randn(N,tau)+1i*randn(N,tau))/sqrt(2),y_p_clean,'UniformOutput',false);

% Transmit pilot after quantization
y_p = cellfun(@(a,b,c)a*b+(mvnrnd(zeros(N,1),c*eye(N),tau)+1i*mvnrnd(zeros(N,1),c*eye(N),tau))'/sqrt(2),...
    y_p,num2cell(alpha,M),num2cell(alpha.*(1-alpha).*(P/tau*SNR_linear*sum(beta.*repmat(activity',M,1),2)+1)),'UniformOutput',false);
x_p_time_domain_double = cellfun(@(a)a'*a,x_p_time_domain,'UniformOutput',false);

% Detection
estimated_activity = mat2cell(zeros(K,M),K,ones(M,1))';
multiplier = mat2cell(zeros(K,M),K,ones(M,1))';
common_estimated_activity = zeros(K,1);

for outer_iteration = 1:10
    estimated_activity = cellfun(@(a,b,c,d,e)update_step_OFDM(N,K,tau,P,SNR_linear,a,b,activity,x_p_time_domain,x_p_time_domain_double,c,d,common_estimated_activity,e),num2cell(alpha),mat2cell(beta,ones(M,1),K),y_p,estimated_activity,multiplier,'UniformOutput',false);
    common_estimated_activity = mean(cell2mat(estimated_activity')+cell2mat(multiplier'),2);
    multiplier = cellfun(@(a,b)a+b-common_estimated_activity,multiplier,estimated_activity,'UniformOutput',false);
    temp(outer_iteration) = max(cell2mat(estimated_activity')-common_estimated_activity,[],'all');
    if temp(outer_iteration)<1e-2
        break;
    end
end

common_estimated_activity = min([common_estimated_activity,ones(K,1)],[],2);
[~,found_index]=maxk(common_estimated_activity,K_active);
success_rate = 1-size(setdiff(index,found_index),2)/K_active;
end

function [estimated_activity] = update_step_OFDM(N,K,tau,P,SNR_linear,alpha,beta,activity,x_p_time_domain,x_p_time_domain_double,y_p,estimated_activity,common_estimated_activity,multiplier)
for inner_iteration = 1:10
    estimated_activity_old = estimated_activity;
    for k = 1:K
        estimated_activity_temp = estimated_activity; estimated_activity_temp(k) = 0;
        % Necessary values
        sigma_noise = alpha^2 + alpha*(1-alpha)*(P/tau*SNR_linear*sum(beta.*activity')+1);
        covariance_k = tau*SNR_linear*alpha^2*sum(cat(3,x_p_time_domain_double{:}).*reshape(estimated_activity_temp.*beta',1,1,[]),3)+sigma_noise*eye(tau);
        uv_temp = x_p_time_domain{k}*inv(covariance_k)*x_p_time_domain{k}';
        [u_temp,v] = eig(uv_temp,'vector');
        u = diag(u_temp*x_p_time_domain{k}*inv(covariance_k)*(y_p'*y_p/N)*inv(covariance_k)*x_p_time_domain{k}'*u_temp');
        
        [potential] = solve_polynomial(P,tau,SNR_linear,beta(k),common_estimated_activity(k),multiplier(k),u,v);
        % ADMM
        real_potential = real(potential(abs(real(potential))./abs(potential)==1));
        if size(real_potential,1)>1
            real_potential(real_potential<0) = 0;
            [~,index] = min(cell2mat(cellfun(@(a)test_log_likelihood(estimated_activity_temp,k,a,tau,SNR_linear,x_p_time_domain_double,beta,y_p,N,alpha,activity,P),num2cell(real_potential),'UniformOutput',false)));
            estimated_activity(k) = max([real_potential(index)',0]);
        elseif size(real_potential,1)==0
            estimated_activity(k) = 0;
        else
            estimated_activity(k) = max([real_potential,0]);
        end
        
    end
    temp(inner_iteration) = max(abs(estimated_activity-estimated_activity_old));
    if temp(inner_iteration) < 1e-2
        break;
    end
end
end

function [potential] = solve_polynomial(P,tau,SNR_linear,beta,common_estimated_activity,multiplier,u,v)
switch(P)
    case 1
        potential = roots([SNR_linear^2*beta^2*tau^2*v^2,...
            (2*SNR_linear*beta*tau*v - SNR_linear^2*beta^2*common_estimated_activity*tau^2*v^2 + SNR_linear^2*beta^2*multiplier*tau^2*v^2),...,
            (SNR_linear^2*beta^2*tau^2*v^2 - 2*SNR_linear*beta*common_estimated_activity*tau*v + 2*SNR_linear*beta*multiplier*tau*v + 1),...
            multiplier - common_estimated_activity - SNR_linear*beta*tau*u + SNR_linear*beta*tau*v]);
    case 2
        potential = roots([SNR_linear^4*beta^4*tau^4*v(1)^2*v(2)^2,...
            (2*SNR_linear^3*beta^3*tau^3*v(1)*v(2)^2 + 2*SNR_linear^3*beta^3*tau^3*v(1)^2*v(2) - SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(1)^2*v(2)^2 + SNR_linear^4*beta^4*multiplier*tau^4*v(1)^2*v(2)^2),...
            (SNR_linear^2*beta^2*tau^2*v(1)^2 + SNR_linear^2*beta^2*tau^2*v(2)^2 + 2*SNR_linear^4*beta^4*tau^4*v(1)^2*v(2)^2 + 4*SNR_linear^2*beta^2*tau^2*v(1)*v(2) - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)*v(2)^2 - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)^2*v(2) + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(1)*v(2)^2 + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(1)^2*v(2)),...
            (2*SNR_linear*beta*tau*v(1) + 2*SNR_linear*beta*tau*v(2) - SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(1)^2 - SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(2)^2 + SNR_linear^2*beta^2*multiplier*tau^2*v(1)^2 + SNR_linear^2*beta^2*multiplier*tau^2*v(2)^2 - SNR_linear^3*beta^3*tau^3*u(1)*v(2)^2 - SNR_linear^3*beta^3*tau^3*u(2)*v(1)^2 + 3*SNR_linear^3*beta^3*tau^3*v(1)*v(2)^2 + 3*SNR_linear^3*beta^3*tau^3*v(1)^2*v(2) + 4*SNR_linear^2*beta^2*multiplier*tau^2*v(1)*v(2) - 4*SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(1)*v(2)),...
            (SNR_linear^2*beta^2*tau^2*v(1)^2 + SNR_linear^2*beta^2*tau^2*v(2)^2 - 2*SNR_linear*beta*common_estimated_activity*tau*v(1) - 2*SNR_linear*beta*common_estimated_activity*tau*v(2) + 2*SNR_linear*beta*multiplier*tau*v(1) + 2*SNR_linear*beta*multiplier*tau*v(2) - 2*SNR_linear^2*beta^2*tau^2*u(1)*v(2) - 2*SNR_linear^2*beta^2*tau^2*u(2)*v(1) + 4*SNR_linear^2*beta^2*tau^2*v(1)*v(2) + 1),...
            multiplier - common_estimated_activity - SNR_linear*beta*tau*u(1) - SNR_linear*beta*tau*u(2) + SNR_linear*beta*tau*v(1) + SNR_linear*beta*tau*v(2)]);
    case 3
        potential = roots([SNR_linear^6*beta^6*tau^6*v(1)^2*v(2)^2*v(3)^2,...
            (2*SNR_linear^5*beta^5*tau^5*v(1)*v(2)^2*v(3)^2 + 2*SNR_linear^5*beta^5*tau^5*v(1)^2*v(2)*v(3)^2 + 2*SNR_linear^5*beta^5*tau^5*v(1)^2*v(2)^2*v(3) - SNR_linear^6*beta^6*common_estimated_activity*tau^6*v(1)^2*v(2)^2*v(3)^2 + SNR_linear^6*beta^6*multiplier*tau^6*v(1)^2*v(2)^2*v(3)^2),...
            (SNR_linear^4*beta^4*tau^4*v(1)^2*v(2)^2 + SNR_linear^4*beta^4*tau^4*v(1)^2*v(3)^2 + SNR_linear^4*beta^4*tau^4*v(2)^2*v(3)^2 + 3*SNR_linear^6*beta^6*tau^6*v(1)^2*v(2)^2*v(3)^2 + 4*SNR_linear^4*beta^4*tau^4*v(1)*v(2)*v(3)^2 + 4*SNR_linear^4*beta^4*tau^4*v(1)*v(2)^2*v(3) + 4*SNR_linear^4*beta^4*tau^4*v(1)^2*v(2)*v(3) - 2*SNR_linear^5*beta^5*common_estimated_activity*tau^5*v(1)*v(2)^2*v(3)^2 - 2*SNR_linear^5*beta^5*common_estimated_activity*tau^5*v(1)^2*v(2)*v(3)^2 - 2*SNR_linear^5*beta^5*common_estimated_activity*tau^5*v(1)^2*v(2)^2*v(3) + 2*SNR_linear^5*beta^5*multiplier*tau^5*v(1)*v(2)^2*v(3)^2 + 2*SNR_linear^5*beta^5*multiplier*tau^5*v(1)^2*v(2)*v(3)^2 + 2*SNR_linear^5*beta^5*multiplier*tau^5*v(1)^2*v(2)^2*v(3)),...
            (2*SNR_linear^3*beta^3*tau^3*v(1)*v(2)^2 + 2*SNR_linear^3*beta^3*tau^3*v(1)^2*v(2) + 2*SNR_linear^3*beta^3*tau^3*v(1)*v(3)^2 + 2*SNR_linear^3*beta^3*tau^3*v(1)^2*v(3) + 2*SNR_linear^3*beta^3*tau^3*v(2)*v(3)^2 + 2*SNR_linear^3*beta^3*tau^3*v(2)^2*v(3) + 8*SNR_linear^3*beta^3*tau^3*v(1)*v(2)*v(3) - SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(1)^2*v(2)^2 - SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(1)^2*v(3)^2 - SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(2)^2*v(3)^2 + SNR_linear^4*beta^4*multiplier*tau^4*v(1)^2*v(2)^2 + SNR_linear^4*beta^4*multiplier*tau^4*v(1)^2*v(3)^2 + SNR_linear^4*beta^4*multiplier*tau^4*v(2)^2*v(3)^2 - SNR_linear^5*beta^5*tau^5*u(1)*v(2)^2*v(3)^2 - SNR_linear^5*beta^5*tau^5*u(2)*v(1)^2*v(3)^2 - SNR_linear^5*beta^5*tau^5*u(3)*v(1)^2*v(2)^2 + 5*SNR_linear^5*beta^5*tau^5*v(1)*v(2)^2*v(3)^2 + 5*SNR_linear^5*beta^5*tau^5*v(1)^2*v(2)*v(3)^2 + 5*SNR_linear^5*beta^5*tau^5*v(1)^2*v(2)^2*v(3) - 4*SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(1)*v(2)*v(3)^2 - 4*SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(1)*v(2)^2*v(3) - 4*SNR_linear^4*beta^4*common_estimated_activity*tau^4*v(1)^2*v(2)*v(3) + 4*SNR_linear^4*beta^4*multiplier*tau^4*v(1)*v(2)*v(3)^2 + 4*SNR_linear^4*beta^4*multiplier*tau^4*v(1)*v(2)^2*v(3) + 4*SNR_linear^4*beta^4*multiplier*tau^4*v(1)^2*v(2)*v(3)),...
            (SNR_linear^2*beta^2*tau^2*v(1)^2 + SNR_linear^2*beta^2*tau^2*v(2)^2 + SNR_linear^2*beta^2*tau^2*v(3)^2 + 2*SNR_linear^4*beta^4*tau^4*v(1)^2*v(2)^2 + 2*SNR_linear^4*beta^4*tau^4*v(1)^2*v(3)^2 + 2*SNR_linear^4*beta^4*tau^4*v(2)^2*v(3)^2 + 4*SNR_linear^2*beta^2*tau^2*v(1)*v(2) + 4*SNR_linear^2*beta^2*tau^2*v(1)*v(3) + 4*SNR_linear^2*beta^2*tau^2*v(2)*v(3) - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)*v(2)^2 - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)^2*v(2) - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)*v(3)^2 - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)^2*v(3) - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(2)*v(3)^2 - 2*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(2)^2*v(3) + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(1)*v(2)^2 + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(1)^2*v(2) + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(1)*v(3)^2 + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(1)^2*v(3) + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(2)*v(3)^2 + 2*SNR_linear^3*beta^3*multiplier*tau^3*v(2)^2*v(3) - 2*SNR_linear^4*beta^4*tau^4*u(1)*v(2)*v(3)^2 - 2*SNR_linear^4*beta^4*tau^4*u(1)*v(2)^2*v(3) - 2*SNR_linear^4*beta^4*tau^4*u(2)*v(1)*v(3)^2 - 2*SNR_linear^4*beta^4*tau^4*u(2)*v(1)^2*v(3) - 2*SNR_linear^4*beta^4*tau^4*u(3)*v(1)*v(2)^2 - 2*SNR_linear^4*beta^4*tau^4*u(3)*v(1)^2*v(2) + 8*SNR_linear^4*beta^4*tau^4*v(1)*v(2)*v(3)^2 + 8*SNR_linear^4*beta^4*tau^4*v(1)*v(2)^2*v(3) + 8*SNR_linear^4*beta^4*tau^4*v(1)^2*v(2)*v(3) - 8*SNR_linear^3*beta^3*common_estimated_activity*tau^3*v(1)*v(2)*v(3) + 8*SNR_linear^3*beta^3*multiplier*tau^3*v(1)*v(2)*v(3)),...
            (2*SNR_linear*beta*tau*v(1) + 2*SNR_linear*beta*tau*v(2) + 2*SNR_linear*beta*tau*v(3) - SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(1)^2 - SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(2)^2 - SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(3)^2 + SNR_linear^2*beta^2*multiplier*tau^2*v(1)^2 + SNR_linear^2*beta^2*multiplier*tau^2*v(2)^2 + SNR_linear^2*beta^2*multiplier*tau^2*v(3)^2 - SNR_linear^3*beta^3*tau^3*u(1)*v(2)^2 - SNR_linear^3*beta^3*tau^3*u(2)*v(1)^2 - SNR_linear^3*beta^3*tau^3*u(1)*v(3)^2 - SNR_linear^3*beta^3*tau^3*u(3)*v(1)^2 - SNR_linear^3*beta^3*tau^3*u(2)*v(3)^2 - SNR_linear^3*beta^3*tau^3*u(3)*v(2)^2 + 3*SNR_linear^3*beta^3*tau^3*v(1)*v(2)^2 + 3*SNR_linear^3*beta^3*tau^3*v(1)^2*v(2) + 3*SNR_linear^3*beta^3*tau^3*v(1)*v(3)^2 + 3*SNR_linear^3*beta^3*tau^3*v(1)^2*v(3) + 3*SNR_linear^3*beta^3*tau^3*v(2)*v(3)^2 + 3*SNR_linear^3*beta^3*tau^3*v(2)^2*v(3) + 4*SNR_linear^2*beta^2*multiplier*tau^2*v(1)*v(2) + 4*SNR_linear^2*beta^2*multiplier*tau^2*v(1)*v(3) + 4*SNR_linear^2*beta^2*multiplier*tau^2*v(2)*v(3) - 4*SNR_linear^3*beta^3*tau^3*u(1)*v(2)*v(3) - 4*SNR_linear^3*beta^3*tau^3*u(2)*v(1)*v(3) - 4*SNR_linear^3*beta^3*tau^3*u(3)*v(1)*v(2) + 12*SNR_linear^3*beta^3*tau^3*v(1)*v(2)*v(3) - 4*SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(1)*v(2) - 4*SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(1)*v(3) - 4*SNR_linear^2*beta^2*common_estimated_activity*tau^2*v(2)*v(3)),...
            (SNR_linear^2*beta^2*tau^2*v(1)^2 + SNR_linear^2*beta^2*tau^2*v(2)^2 + SNR_linear^2*beta^2*tau^2*v(3)^2 - 2*SNR_linear*beta*common_estimated_activity*tau*v(1) - 2*SNR_linear*beta*common_estimated_activity*tau*v(2) - 2*SNR_linear*beta*common_estimated_activity*tau*v(3) + 2*SNR_linear*beta*multiplier*tau*v(1) + 2*SNR_linear*beta*multiplier*tau*v(2) + 2*SNR_linear*beta*multiplier*tau*v(3) - 2*SNR_linear^2*beta^2*tau^2*u(1)*v(2) - 2*SNR_linear^2*beta^2*tau^2*u(2)*v(1) - 2*SNR_linear^2*beta^2*tau^2*u(1)*v(3) - 2*SNR_linear^2*beta^2*tau^2*u(3)*v(1) - 2*SNR_linear^2*beta^2*tau^2*u(2)*v(3) - 2*SNR_linear^2*beta^2*tau^2*u(3)*v(2) + 4*SNR_linear^2*beta^2*tau^2*v(1)*v(2) + 4*SNR_linear^2*beta^2*tau^2*v(1)*v(3) + 4*SNR_linear^2*beta^2*tau^2*v(2)*v(3) + 1),...
            multiplier - common_estimated_activity - SNR_linear*beta*tau*u(1) - SNR_linear*beta*tau*u(2) - SNR_linear*beta*tau*u(3) + SNR_linear*beta*tau*v(1) + SNR_linear*beta*tau*v(2) + SNR_linear*beta*tau*v(3)]);
    case 4
